import React from 'react';
import './App.css';

function App() {
  const renderBoard = () => {
    let board = [];

    for (let i = 0; i < 8; i++) {
      let row = [];
      for (let j = 0; j < 8; j++) {
        row.push(<div className={`tile ${((i + j) % 2 === 0) ? 'white' : 'black'}`}></div>);
      }
      board.push(<div className="row">{row}</div>);
    }

    return board;
  }

  return (
    <div className="App">
      {renderBoard()}
    </div>
  );
}

export default App;
